import React from 'react';
import MapImage from '../public/assets/map-image.png';

class ContactContent extends React.Component {
    constructor(props) {
      super(props);

    }

    render() {
        if (this.props.visible === true) {
            return (
            <div id="contentContainer">
              <p id="contactText">Contact info goes here</p>
              <div className="contentCanvas">
                <img id="mapImg"  src={MapImage} />
              </div>

              <style jsx>
                {`

                #contentContainer {
                  position: absolute;
                  margin-top: 175px;
                  height: 60vh;
                  margin-left: 10%;
                  width: 80vw;
                  background-image: url('data:image/png;base64,');
                  background-color: rgb(192,192,192);
                  border-radius: 8px;
                  min-width: 450px;
                }

                @media (max-width: 720px) {
                  #contentContainer {
                    height: 73vh;
                    min-height: 575px;
                  }
                }
                
                #mapImg {
                  width: 50%;
                  height: 90%;
                  border-radius: 12px;
                  position: absolute;
                  min-width: 400px;
                  min-height: 300px;
                  right: 0px;
                  margin-top: 2%;
                }

                @media (max-width: 720px) {
                  #mapImg {
                    height: 300px;
                  }
                }
              
                .contentCanvas {
                  width: 90%;
                  height: 100%;
                  transform: translate(0%, 0%);
                  margin: auto;
                }

                #contactText {
                  width: 40%;
                  position: absolute;
                }
                
                `}
              </style>
            </div>)
            } else {
                return (null)
            };
    }
}

export default ContactContent;
